import React, { useState } from 'react';
import { GoogleMap, LoadScript, KmlLayer } from '@react-google-maps/api';
import countriesKml from './countries.kml';

const originalCenter = {
  lat: 32, 
  lng: 20
};

const containerStyle = {
  width: '800px',
  height: '400px' 
};

function Map() {

  const [apiKey, setApiKey] = useState('');

  useEffect(() => {
    fetch('/api/key')
      .then(res => res.text())
      .then(setApiKey);
  }, []);

  const [center, setCenter] = useState(originalCenter);

  return (
    <LoadScript 
      googleMapsApiKey={apiKey}
    >
     <GoogleMap
       center={center}
       zoom={2}
       mapContainerStyle={containerStyle}
     >
       <KmlLayer
         data={countriesKml}
         options={{
           preserveViewport: true,
           fillColor: 'green',
           fillOpacity: 0.5,
           strokeColor: 'white',
           strokeWeight: 2
         }}
       />
     </GoogleMap>
    </LoadScript>
  );
}

export default Map;
